  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { PropsTable, Playground } from 'docz';
import CreateMessage from './CreateMessage.tsx'

export default ({components, ...props}) => <MDXTag name="wrapper"  components={components}>
<MDXTag name="h1" components={components} props={{"id":"createchatroom"}}>{`CreateChatRoom`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"basic-usage"}}>{`Basic Usage`}</MDXTag>
<Playground __position={0} __code={`<CreateMessage
  handleChange={event => event.target.value}
  handleSubmit={event => event.preventDefault()}
  placeholder={\'Send a message to Active ChatRoom\'}
  value={\'Hey this is a message!\'}
/>`} __scope={{props,CreateMessage}} >
  <CreateMessage
    handleChange={(event) => event.target.value}
    handleSubmit={(event) => event.preventDefault()}
    placeholder={'Send a message to Active ChatRoom'}
    value={'Hey this is a message!'}
  />
</Playground>
<MDXTag name="hr" components={components}></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"properties"}}>{`Properties`}</MDXTag>
<PropsTable of={CreateMessage} /></MDXTag>
